using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace Film.TypeOf
{

    public class Base64FileJsonConverter : JsonConverter
    {
        public override bool CanConvert(Type objectType)
        {
            return objectType == typeof(string);


        }


        public override object ReadJson(JsonReader reader, Type objectType, object existingValue, JsonSerializer serializer)
        {
            //if (reader.Value != null)
            //{
                string[] words = reader.Value.ToString().Split("data:image/png;base64,");
                return Convert.FromBase64String(words[words.Length - 1]);
            //}
           // return Convert.FromBase64String("");
            //return Convert.FromBase64String(
           // ""

               //);
        }

        //Because we are never writing out as Base64, we don't need this. 
        public override void WriteJson(JsonWriter writer, object value, JsonSerializer serializer)
        {
            writer.WriteValue("data:image/png;base64," + Convert.ToBase64String((byte[])value));
        }
    }
}